      "name" => "parseFundingRate",
      "signature" => "parseFundingRate (contract, market: Market = undefined): FundingRate",
      "source" => "parseFundingRate (contract, market: Market = undefined): FundingRate {\n        //\n        //     {\n        //         \"symbol\": \"BTC_USDT\",\n        //         \"fundingRate\": 0.000014,\n        //         \"maxFundingRate\": 0.003,\n        //         \"minFundingRate\": -0.003,\n        //         \"collectCycle\": 8,\n        //         \"nextSettleTime\": 1643241600000,\n        //         \"timestamp\": 1643240373359\n        //     }\n        //\n        const nextFundingRate = this.safeNumber (contract, 'fundingRate');\n        const nextFundingTimestamp = this.safeInteger (contract, 'nextSettleTime');\n        const marketId = this.safeString (contract, 'symbol');\n        const symbol = this.safeSymbol (marketId, market, undefined, 'contract');\n        const timestamp = this.safeInteger (contract, 'timestamp');\n        const interval = this.safeString (contract, 'collectCycle');\n        let intervalString = undefined;\n        if (interval !== undefined) {\n            intervalString = interval + 'h';\n        }\n        return {\n            'info': contract,\n            'symbol': symbol,\n            'markPrice': undefined,\n            'indexPrice': undefined,\n            'interestRate': undefined,\n            'estimatedSettlePrice': undefined,\n            'timestamp': timestamp,\n            'datetime': this.iso8601 (timestamp),\n            'fundingRate': nextFundingRate,\n            'fundingTimestamp': nextFundingTimestamp,\n            'fundingDatetime': this.iso8601 (nextFundingTimestamp),\n            'nextFundingRate': undefined,\n            'nextFundingTimestamp': undefined,\n            'nextFundingDatetime': undefined,\n            'previousFundingRate': undefined,\n            'previousFundingTimestamp': undefined,\n            'previousFundingDatetime': undefined,\n            'interval': intervalString,\n        } as FundingRate;\n    }"
    },
